import React, { useState } from 'react';
import { Container, Row, Col, Button, Card, Alert } from 'react-bootstrap';
import MCQForm from '../components/MCQForm';

function DemoPage() {
  const [questions, setQuestions] = useState([]);
  const [examCreated, setExamCreated] = useState(false);

  const addQuestion = (question) => {
    setQuestions([...questions, question]);
  };

  const createDemoExam = () => {
    if (questions.length === 0) {
      alert('Add at least one question to create the demo exam.');
      return;
    }
    setExamCreated(true);
  };

  return (
    <Container className="mt-5">
      {!examCreated ? (
        <>
          <h2><i className="bi bi-play-circle"></i> Try Demo - Create MCQs as Teacher</h2>
          <Alert variant="info">
            Add some questions below to simulate creating an exam. Once done, click "Create Demo Exam" to view it.
          </Alert>
          <MCQForm onAddQuestion={addQuestion} isDemo={true} />
          <div className="mt-4">
            <h4>Added Questions ({questions.length}):</h4>
            {questions.length > 0 ? (
              questions.map((q, idx) => (
                <Card key={idx} className="mb-3">
                  <Card.Body>
                    <p><strong>Question {idx + 1}:</strong> {q.question}</p>
                    <ul>
                      {q.options.map((opt, optIdx) => (
                        <li key={optIdx}>{opt} {optIdx === q.correctOption ? '(Correct)' : ''}</li>
                      ))}
                    </ul>
                  </Card.Body>
                </Card>
              ))
            ) : (
              <p>No questions added yet.</p>
            )}
          </div>
          <Button onClick={createDemoExam} variant="success" size="lg" className="mt-3">
            <i className="bi bi-check-circle"></i> Create Demo Exam
          </Button>
        </>
      ) : (
        <>
          <h2><i className="bi bi-eye"></i> Demo Exam Preview</h2>
          <Alert variant="success">
            This is a preview of your demo exam. In the real app, students would take it with a timer.
          </Alert>
          {questions.map((q, idx) => (
            <Card key={idx} className="mb-3">
              <Card.Body>
                <p><strong>Question {idx + 1}:</strong> {q.question}</p>
                {q.options.map((opt, optIdx) => (
                  <div key={optIdx} className="form-check">
                    <input
                      className="form-check-input"
                      type="radio"
                      name={`question-${idx}`}
                      id={`option-${idx}-${optIdx}`}
                      disabled
                    />
                    <label className="form-check-label" htmlFor={`option-${idx}-${optIdx}`}>
                      {opt}
                    </label>
                  </div>
                ))}
                <small className="text-muted">Correct Answer: Option {q.correctOption + 1}</small>
              </Card.Body>
            </Card>
          ))}
          <Button onClick={() => setExamCreated(false)} variant="secondary" className="mt-3">
            <i className="bi bi-arrow-left"></i> Back to Add Questions
          </Button>
        </>
      )}
    </Container>
  );
}

export default DemoPage;
